import React from 'react';
import './projectcard.css';
// import ProjectImg from '../assets/images/projectImg.png'
export default function Projectcard(props) {
  return (
    <div>
      {/* repeating card */}
      <div className='project-card'>
            <div className='project-img'>
                <img src={props.imageurl} alt="project-photo" className='project-photo' />
            </div>
            <div className='project-decription'>
                    <p className='project-name'>U Tracker</p>
                    <p className='project-text'>An application to track your all data from one place. I developed the website and mobile app.</p>
            </div>
            
        </div>
    </div>
  )
}
